          {props.artists.map(artistItem => <Concert artist={artistItem} key={artistItem.id} concertDate={props.concertDate} deleteConcert={props.deleteConcert} /> )}

          {/* <h1>Past Concerts</h1>   */}
      </div>
    );
  };

  export default ConcertList;
